from typing import List


def remove_duplicates(numbers: List[int]) -> List[int]:
    """ From a list of integers, remove all elements that occur more than once.
    Keep order of elements left the same as in the input.
    >>> remove_duplicates([1, 2, 3, 2, 4])
    [1, 3, 4]
    """
    if not numbers:
        return []

    # Remove duplicates
    duplicates = []
    for i in numbers:
        if i > 1:
            duplicates.append(i)

    # Remove duplicates
    return sorted(duplicates, key=lambda x: x - 1)

from typing import List


def remove_duplicates(numbers: List[int]) -> List[int]:
    """ From a list of integers, remove all elements that occur more than once.
    Keep order of elements left the same as in the input.
    >>> remove_duplicates([1, 2, 3, 2, 4])
    [1, 3, 4]
    """
    if not numbers:
        return []

    # Remove duplicates
    duplicates = []
    for i in numbers:
        if i > 1:
            duplicates.append(i)

    # Remove duplicates that are not in the input
    for i in duplicates:
        if i not in numbers:
            numbers.remove(i)

    return numbers

